import React from "react"



function SkillItem(props){
    let stars = [];
    for(let i = 0;i<props.stars;i++){
        stars.push(<p>: {props.stars}</p>);
       }
    return(<div className="skillSet">
        <p className="skillName">{props.name}</p>

        </div>
    );
};
export default SkillItem;
